import React from "react";
import "./Home.css";

const Home: React.FC = () => {
  return (
    <>
      <h1 className="header">Welcome</h1>
      <div className="this-week">
        <span>monday</span>
        <span>tuesday</span>
      </div>
    </>
  );
};

export default Home;
